import "./App.css";

import { BrowserRouter } from "react-router-dom";
import Burger from "./components/Burger";

import ProductContextProvider from "./context/ProductContextProvider";

function App() {
  return (
    <>
      <ProductContextProvider>
        <BrowserRouter>
          <Burger />
        </BrowserRouter>
      </ProductContextProvider>
    </>
  );
}

export default App;
